	protected static Map<String, Character> map = new LinkedHashMap<String, Character>();
	static {
		map.put("&amp;", (char) 38);
		map.put("&lt;", (char) 60);
		map.put("&gt;", (char) 62);
		map.put("&quot;", (char) 34);
		map.put("&nbsp;", (char) 160);
		map.put("&apos;", (char) 39);
	}
	
