	private static String fromHtmlEntity(String str) {
		Character ch = map.get(str);
		return (ch != null) ? ch.toString() : str;
	}

	private static String findValue(char value) {
		boolean found = false;
		String result = null;
		for (String key : map.keySet()) {
			if (map.get(key).charValue() == value) {
				found = true;
				result = key;
			}

			if (found == true) {
				return result;
			}
		}

		return result;
	}

